import Vue from 'vue' 
import Router from 'vue-router'
import Map from '@/components/Map/CustomMap.vue'
import Login from '@/components/AuthLogin.vue';

Vue.use(Router) 

const router = new Router({ 
routes: [
    { 
      path: '/', 
      name: 'Main', 
      component: Map 
    },
    { 
      path: '/login', 
      name: 'Login', 
      component: Login 
    }
  ] 
}) 
export default router
